import React from 'react';
import { Container, Navbar } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import LoginForm from '../components/auth/LoginForm';
import './Login.css';

const Login = () => {
  return (
    <div className="login-page">
      {/* Header minimal juste pour le branding */}
      <Navbar bg="transparent" className="login-navbar">
        <Container>
          <Navbar.Brand as={Link} to="/" className="login-brand">
            <strong>مكتب استخلاص الديون</strong>
          </Navbar.Brand>
        </Container>
      </Navbar>
      
      <Container fluid className="login-background">
        <LoginForm />
      </Container>
    </div>
  );
};

export default Login;
